import React, { useState, useEffect } from 'react'

const Gallery = () => {
  const [galleryImages, setImgageUrls] = useState([""])
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    populateWithImgUrls()
    if(galleryImages.length < 28) {
      setLoading(true)
    }
  },[galleryImages])

  const populateWithImgUrls = () => {
    let imgUrlArray: any = []
    for(let x = 1; x <= 29; x++ ){
      imgUrlArray.push(`/assets/gallery/p${x}@2x.jpg`)
    }; 

    setImgageUrls(imgUrlArray)
  }

  return (
    <div className="gallery-container">
        <div className="wrapper">
          <ul className="gallery-grid">
            { galleryImages && galleryImages.map((img) => 
              <img key={img} src={img} alt="Gallery Item" />
            )}
          </ul>
        </div>
    </div>
  )
}

export default Gallery;
